The Big Ugly Bill turned its back on families who rely on essential funding for programs like afterschool care and Medicaid, leaving students without the proper support and care they deserve.

What kind of country does that?
@SenPeterWelch https://t.co/rThuKkwnay

Public schools are intended to educate students, regardless of background or disability status.

School vouchers threaten this mission, and risk resegregating communities, by allowing private schools to pick &amp; choose which students to educate.

@SenatorDurbin https://t.co/WrwTvnOwem

By firing career DOJ and FBI employees, Trump is endangering our nation to settle a petty political score.

Fewer experts working to prevent terrorism, violent crime, espionage, narcotics, hacking. The list goes on.

@JudiciaryDems are demanding answers and fighting back.
